// Comment from home

function getLines(data) {

var packetSize = 15;
var maxDelta = 0.30;
var maxDeltaM = 0.20;
var packetStatus = new Array();
//console.log("debug 1: " + data.length);
for (var i=0,p=0; i<data.length;i+=packetSize,p++){
var start = p*packetSize;
var ende = (p+1)*packetSize-1;
if (ende >= data.length || (ende-start+1) < packetSize){ // Letztes Paket uninteressant
break;
}
//console.log("debug 3");
var erg = lreg.linearRegression(start,ende,data);
var max = lreg.maxDeltaRegression(start,ende,data,erg.m,erg.b);
if (max.max>maxDelta) {
packetStatus[p] = {status:0,m:0,b:0,start:start,ende:ende,x:max.avex,y:max.avey};
}
else {
packetStatus[p] = {status:9,m:erg.m,b:erg.b,start:start,ende:ende,x:max.avex,y:max.avey};
}
//console.log("start: " + start + " ende:" + ende + " status:" + packetStatus[p].status + " m:" + Math.abs(erg.m.toFixed(3)));
}
//console.log("debug 10");

var pmax = p-1;
for (var p=1; p<pmax-1; p++){
if (packetStatus[p].status == 9) {
if (Math.abs(packetStatus[p].m-packetStatus[p-1].m) > maxDeltaM || Math.abs(packetStatus[p].m-packetStatus[p+1].m) > maxDeltaM) {
packetStatus[p].status = 1;
}
}
//console.log("p: " + p + " status:" + packetStatus[p].status + " m:" + Math.abs(packetStatus[p].m.toFixed(3)));
}

for (var p=1; p<pmax-1; p++){
if (packetStatus[p].status == 9) {
if (packetStatus[p-1].status != 9 && packetStatus[p+1].status != 9) {
packetStatus[p].status = 2;
}
}
console.log("p: " + p + " status:" + packetStatus[p].status + " x:" + packetStatus[p].x.toFixed(3) + " y:" + packetStatus[p].y.toFixed(3) + " m:" + packetStatus[p].m.toFixed(3) + " b:" + packetStatus[p].b.toFixed(3));
}
var ret = new Array();

var pstart = 0;
var pende = 0;
for (var p=0,l=0; p<pmax; p++){
if (packetStatus[p].status == 9 && pstart == 0) {
pstart = p;
pende = pstart;
}
if ((packetStatus[p].status != 9 && pstart != 0 && pstart == pende) || (packetStatus[p].status == 9 && p == pmax-1)) {
pende = p-1;
var erg = lreg.linearRegression(packetStatus[pstart].start,packetStatus[pende].ende,data);
ret[l] = {m:erg.m,b:erg.b,start:packetStatus[pstart].start,ende:packetStatus[pende].ende};
l++;
pstart = 0;
pende = 0;
//console.log("l: " + l + " m:" + ret[l].m.toFixed(3) + " b:" + ret[l].b.toFixed(3));
}
}
return(ret);
}

function removeShortLines(lines,minLength) {
for (var i = 0; i < lines.length; i++)
{
if ((lines[i].ende-lines[i].start+1) < minLength) {
lines.splice(i,1);
}
}
return(lines);
}

